import Home from './pages/Home'; // Assuming you have these components
import About from './pages/About';
import Ch2Comp from './pages/Ch2Comp';
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import './App.css'; // Import the CSS file


function App() {
  const [stvar, setMess] = useState('');
  const handleClick = () => {
    axios.get('http://localhost:8080/helphealth12')
    .then(response => setMess(response.data))
  }
  return (
    <Router>
      <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<Ch2Comp name = {stvar}/>} />
      </Routes>
      <a href="/">Home</a>
      <Link to ={'/about'} onClick = {handleClick}>About</Link>
      </div>
    </Router>
  );
}

export default App;
